import './Floor2.css';

function Floor2() {
  return (
    <div className='containerF2'>

        <div className='right'>
            <div className='line'></div>
            <div className='titleF2'>
                <p>World Padel Tour et Kuikma</p>
            </div>
            <div className='sentence1F2'>
                <p>Le World Padel Tour est le circuit professionnel qui réunit les meilleurs joueurs du<br></br> monde. Cette année, il se déroulera à Bruxelles, à Tour & Taxis, du 4 au 8 mai.</p>
            </div>
            <div className='sentence2F2'>
                <p></p>
            </div>
        </div>

        <div className='left'>
            <div className='kuikma'></div>
        </div>

    </div>
  );
}

export default Floor2;
